  false,\n\t\"url\": null,\n\t\"notes\": \"This web feature service contains location
  and facility identification information from EPA's Facility Registry Service (FRS)
  for the subset of facilities that link to the Air Quality System (AQS). The AQS
  contains ambient air pollution data collected by EPA, State, Local, and Tribal air
  pollution control agencies from thousands of monitoring stations. FRS identifies
  and geospatially locates facilities, sites or places subject to environmental regulations
  or of environmental interest. Using vigorous verification and data management procedures,
  FRS integrates facility data from EPA's national program systems, other federal
  agencies, and State and tribal master facility records and provides EPA with a centrally
  managed, single source of comprehensive and authoritative information on facilities.
  This data set contains the subset of FRS integrated facilities that link to monitoring
  stations once the AQS data has been integrated into the FRS database. Additional
  information on FRS is available at the EPA website http://www.epa.gov/enviro/html/fii/index.html.\",\n\t\"license_title\":
